import React, {Component} from "react";
import './Navbar.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import home from './homepage.jpg';
import {
    Collapse,
    Navbar,
    NavbarToggler,
    NavbarBrand,
    Nav,
    NavItem,
    NavLink,
    UncontrolledDropdown,
    DropdownToggle,
    DropdownMenu, Media,
    DropdownItem } from 'reactstrap';
export class Home extends Component {
    constructor(props) {
      super(props);
    }
    render() {
    //Photo by American Public Power Association on Unsplash
      return (
        <div className="Home" style= {{ alignSelf: 'stretch', width: '100%',
        height: "50%",
        aspectRatio: 1,}}>
          <img style={{
            flex: 1,
            alignSelf: 'stretch',
            width: "100%",
            height: "50%"
            }}
        src={home} 
  
        resizeMode="contain"/>
        </div>,
        <h>Empowering Knowledge</h>
      );
    }
}

export default Home;
